`,c.jsx(i.li,{children:"The first few lines should contain the punchline."}),`
`]}),`
`,c.jsx(i.p,{children:"Write notes for future retrieval, not for present perfection."}),`
`,c.jsx(i.h2,{children:"Structure vs Discovery: Two Relationship Layers"}),`
`,c.jsx(i.p,{children:"I keep two relationship layers on purpose:"}),`
`,c.jsxs(i.ul,{children:[`
`,c.jsxs(i.li,{children:[c.jsx(i.strong,{children:"Manual links (strong edges):"})," deliberate, sparse, stable. They define structure."]}),`
`,c.jsxs(i.li,{children:[c.jsx(i.strong,{children:"Semantic related (weak edges):"})," helpful but noisy. They suggest neighbors."]}),`
`]}),`
`,c.jsx(i.p,{children:"This separation prevents the knowledge graph from becoming an unmaintainable web of low-confidence edges."}),`
`,c.jsx(i.h2,{children:"Traceability: Make Outputs Auditable"}),`
`,c.jsx(i.p,{children:"If the system cannot explain itself, you cannot trust it."}),`
`,c.jsxs(i.p,{children:["So every output keeps ",c.jsx(i.code,{children:"citations"})," (note IDs or chunk IDs) so you can:"]}),`
`,c.jsxs(i.ul,{children:[`
`,c.jsx(i.li,{children:"review and edit with confidence"}),`
`,c.jsx(i.li,{children:"debug why did this paragraph exist?"}),`
