`,c.jsx(i.p,{children:"Asset/accounting statistics look like just math, but what makes them hard is not arithmetic."}),`
`,c.jsx(i.p,{children:"The hard part is operational:"}),`
`,c.jsxs(i.ul,{children:[`
`,c.jsxs(i.li,{children:["upstream inputs are ",c.jsx(i.strong,{children:"untrusted"})]}),`
`,c.jsxs(i.li,{children:["every value needs ",c.jsx(i.strong,{children:"evidence"})," (not just plausibility)"]}),`
