`,c.jsx(i.h2,{children:"The real scaling problem is human time"}),`
`,c.jsx(i.p,{children:"Asset statistics pipelines often have dozens of steps across multiple layers (raw inputs  normalization  enrichment  aggregation  metrics)."}),`
`,c.jsx(i.p,{children:"Even when true bugs become rarer over time, investigations still consume a lot of time because each report demands tracing a long chain."}),`
`,c.jsx(i.p,{children:"And the cause distribution shifts: fewer pure code bugs, more upstream data issues and misunderstandings."}),`
