`,c.jsx(i.h2,{children:"Precision is a product requirement"}),`
`,c.jsx(i.p,{children:"This is one of the biggest differences from recommendation systems."}),`
`,c.jsx(i.p,{children:"If a recommender suggests the wrong product or article, it is usually wrong, but fine."}),`
