`,c.jsx(i.li,{children:"document the rules"}),`
`,c.jsx(i.li,{children:"keep them consistent across pipeline, storage, and UI"}),`
`]}),`
`,c.jsx(i.h2,{children:"Privacy vs debugging is a real trade-off"}),`
`,c.jsx(i.p,{children:"Users asset information is private."}),`
`,c.jsx(i.p,{children:"But when a user reports your numbers are wrong, engineering investigation almost always requires looking at the users asset-related data."}),`
`,c.jsx(i.p,{children:"From the users perspective, that can feel like a privacy violation."}),`
`,c.jsx(i.p,{children:"So a common requirement shows up:"}),`
`,c.jsxs(i.blockquote,{children:[`
`,c.jsx(i.p,{children:"Can you debug it without touching the users private data?"}),`
