`,c.jsx(i.p,{children:"Boundary condition: if the upstream source repeatedly produces the same pattern, treat it as a system issue (contract fixes, validation, quarantining), not an endless sequence of one-offs."}),`
`,c.jsx(i.h2,{children:"The fix-layer trap"}),`
`,c.jsx(i.p,{children:"When upstream systems are messy, teams often introduce a fix layer: a dedicated layer of hard-coded rules to patch known bad records or patterns."}),`
